import React from "react";
import "./App.css";
import LoginBox from "./components/layout/LoginBox";
import { BrowserRouter as Router } from "react-router-dom";
const App = () => {
  return (
    <BrowserRouter>

      <Router exact path='/' component={LoginBox}/>

    </BrowserRouter>
  );
};

export default App;
